              console.log("new image: " + res.data.new_image);
              result.src = "http://10.10.0.167:5526/static/processed_file/"+res.data.new_image;
              loader.style.display = "none";
              processing.style.display = "none";
              date = new Date();
              var end = date.getTime();
              axios.get('http://10.10.0.167:5526/predict', {
                  params: {
                    processed: res.data.new_image
                  }
                })
